import * as constant from '../constant'

export const fetchAllTodo = () => ({
    type : constants.API,
    payload: {
        methode : 'GET',
        url : '/api/TodoCategory',
        success : (response) => (setAllTodo(response))
    }
})


const setAllTodo = (data) => ({
    type : constants.FETCH_ALL_TODO,
    payload: data
})
